(9, 1, '2022-07-17 05:26:37', '2022-07-17 05:26:37', '<style>/*! elementor - v3.6.7 - 03-07-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h1>IVANIA CALDERON MARIN</h1>		\n			<style>/*! elementor - v3.6.7 - 03-07-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"768\" height=\"1024\" src=\"http://localhost/cvWebpage/wp-content/uploads/2022/07/WhatsApp-Image-2022-07-16-at-11.38.34-PM.jpeg\" alt=\"\" loading=\"lazy\" />', 'Home', '', 'publish', 'closed', 'closed', '', 'ivaniacalderon', '', '', '2022-07-19 19:13:21', '2022-07-19 19:13:21', '', 0, 'http://localhost/cvWebpage/?page_id=9', 0, 'page', '', 0),
